import React, { Component } from "react";
import { Link } from "react-router-dom";
class createProjectButton extends Component {
  render() {
    return (
      <React.Fragment>
        <Link to="/addProject" className="btn btn-lg btn-info">
          Create a Project
        </Link>
      </React.Fragment>
    );
  }
}
export default createProjectButton;
